import React, { useEffect, useState } from 'react';
import axios from "axios";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import LoginPage from './pages/LoginPage.js';
import RegisterPage from './pages/RegisterPage.js';
import ProfilePage from './pages/ProfilePage.js';
import MainPage from './pages/MainPage.js';
import AdminPage from './pages/AdminPage.js';
import ManageAdmins from './pages/ManageAdmins.js';
import ManageCategories from './pages/ManageCategories.js';
import CreateQuiz from './pages/CreateQuiz.js';
import ManageQuizes from './pages/ManageQuizes.js';
import ManageSpecificQuiz from './pages/ManageSpecificQuiz.js'


function App() {

    const [ isBackendData, setBackendData] = useState([{}]);
    const [sessionUsername, setSessionUsername] = useState(null);
    const [isLoading, setIsLoading] = useState(true);



    useEffect(() => {
    // First session load
        axios.get('http://localhost:5000').then(res => {
            if(res.data.valid) {
                setSessionUsername(res.data.username);
            }
        }). catch(err => console.log(err));
    }, []);

    //////////////////////////////////////////////////////////////////////////////////




    return ( 
        <div>
            <BrowserRouter>
                <Routes>
                    <Route path ="/" element = {<MainPage />} />
                    <Route path="/login" element={<LoginPage />} />
                    <Route path="/register" element={<RegisterPage />} />
                    <Route path="/profile" element={<ProfilePage />} />
                    <Route path="/admin" element={<AdminPage />} />
                    <Route path="/admin/manageAdmins" element={<ManageAdmins />} />
                    <Route path="/admin/manageCategories" element={<ManageCategories />} />
                    <Route path="/admin/createQuiz" element = {<CreateQuiz/>} />
                    <Route path="/admin/manageQuizes" element = {<ManageQuizes/>}/>
                    <Route path="/admin/manageQuizes/:sifKviz" element = {<ManageSpecificQuizes/>}/>
                </Routes>
            </ BrowserRouter>
        </div>
    );
}

export default App;
